function findAndDel(arr, id) {
  if (Array.isArray(arr)) {
    arr.forEach((item, key) => {
      if ('children' in item) findAndDel(item.children, id);
      else if (item.id === id) arr.splice(key, 1);
    });
  }
}

function cleanEmptyParent(arr) {
  if (Array.isArray(arr)) {
    arr.forEach((item, key) => {
      if ('children' in item) {
        if (item.children.length === 0)
          arr.splice(key, 1);
        cleanEmptyParent(item.children, id);
      }
    });
  }
}

